export default function NavItems() {
  const role = JSON.parse(localStorage.getItem("loggedInUser")).role;

  let route;
  if (role === "admin") {
    route = "superadmin";
  } else if (role === "dietician") {
    route = "dietician";
  } else if (role === "patient") {
    route = "patient";
  } else {
    return route;
  }
